Een lagekostenluchtvaartmaatschappij, ook wel prijsvechter, lowfare-, lowcost-, no-frills-, budget-, lowbudget-, no-nonsense- of discountmaatschappij genoemd, is een luchtvaartmaatschappij die volgens het no frills-concept werkt, waarbij de overheadkosten laag gehouden worden en de extra diensten niet bij de prijs zijn inbegrepen. In het algemeen zijn de kenmerken van lagekostenluchtvaartmaatschappijen: 
* Directe vluchten over een korte afstand, vaak van kleinere vliegvelden met lagere luchthaven- en afhandelingskosten; 
* Een gestandaardiseerde vloot van narrow-body vliegtuigen; 
* De toestellen hebben slechts één reizigersaccommodatieklasse om zoveel mogelijk zitplaatsen te creëren; 
* De vliegtuigen worden intensief gebruikt en de doorlooptijden op luchthavens zijn zo kort mogelijk; 
* De prijs van een vliegticket is laag, maar dit wordt gecompenseerd door een hoog volume en dus hoge bezettingsgraad; 
* Een minimum van diensten is in de ticketprijs inbegrepen, voor andere diensten, zoals bagagevervoer en consumpties aan boord, moet worden (bij)betaald; 
* Intensief gebruik van informatietechnologie (internet) om de distributiekosten te verlagen; 
* Inzet op lage kosten voor personeel, marketing en algemene administratiekosten. Het concept werd omstreeks de jaren zeventig voor het eerst geïntroduceerd. In de Verenigde Staten is Southwest Airlines een pionier die dit bedrijfsmodel volgt. In Noord-Amerika hebben de lagekostenluchtvaartmaatschappijen ongeveer een marktaandeel van 30% van de totale zitplaatscapaciteit op vluchten over een korte afstand en in Europa ligt dit rond de 40%. Sinds ongeveer 2000 zijn ze sterk in opkomst in Azië, in sommige markten, waaronder India hebben ze meer dan 60% van de capaciteit in handen. Om beter te concurreren starten de grotere luchtvaartmaatschappijen een eigen lowcost-luchtvaartmaatschappij. Deze dochtermaatschappijen zijn nieuw opgericht of omgevormd van een feedermodel naar een lowfare-model om marktaandeel te kunnen behouden. In veel gevallen blijft de feeder-functie wel aanwezig. Voorbeelden hiervan zijn Transavia van Air France-KLM, Eurowings van Lufthansa en Jetstar van Qantas. Een latere ontwikkeling is de uitbreiding van lagekostenluchtvaartmaatschappijen voor vluchten over grotere afstand. In 2008 was slechts 1% van de totale capaciteit gericht op vluchten van meer dan 5500 km, maar 10 jaar later is dit gegroeid naar 4%. Deze diensten zijn complexer in vergelijking tot vluchten op korte afstand, de vliegtuigen zijn groter en daardoor duurder, er zijn meer regels en toezichthouders en de vluchttijden zijn langer waardoor de kortere doorlooptijden op luchthavens minder voordeel oplevert. Norwegian is een voorbeeld van een lagekostenluchtvaartmaatschappij die een plaats wil behalen in het vervoer over lange afstanden.
